THE ALEX JONES SHOW
2009.04.16 Thursday

Alex welcomes back to the show Stewart Rhodes, founder of Oath Keepers, an organization of military, veterans, and peace officers dedicated to honor their oaths to defend the Constitution. Radio and television personality Mancow Muller checks in with a report on the tea party demonstrations yesterday. Alex was scheduled with Andrew Napolitano, a life-tenured Superior Court Judge in New Jersey, Fox News analyst and show host, and author of The Constitution in Exile: How the Federal Government Has Seized Power by Rewriting the Supreme Law of the Land but Napolitano interview fell through. Alex also discusses the important issues of the day and takes your calls.

HR 1: News, deconstructs mainstream media on protests, Eric &quot;Mancow&quot; Muller
HR 2: Open lines
HR 3: Open lines, STEWART RHODES
HR 4: Music intro, breaking news and commentary, open lines


